};

function Song(props) {
  const data = [
    {
      id: 1,
      name: 'Time Job',
      img: 'https://photo-resize-zmp3.zadn.vn/w480_r1x1_jpeg/cover/f/4/e/7/f4e7ea36ae561ef14e56852cf98c4231.jpg',
    },
    {
      id: 2,
      name: 'Wifi Mesh',
      img: 'https://photo-resize-zmp3.zadn.vn/w480_r1x1_jpeg/cover/a/4/0/c/a40cd0259a4b97546aa15d316a0ff1cb.jpg',
    },
    {
      id: 3,
      name: 'Refeater',
      img: 'https://photo-resize-zmp3.zadn.vn/w480_r1x1_jpeg/cover/5/5/4/d/554d9029ba74227d965a40a83261810b.jpg',
    },
  ];
  return (
    <div>
      <h1>Co the ban se thich</h1>
      <AlbumList albumList={data}></AlbumList>
    </div>
  );
}

export default Song;
